import React, { useEffect, useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import axios from "axios";
import * as e from "../style/styledreviewcheck1";

const Reviewcheck1 = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { product, review, selectedImage } = location.state || {}; // selectedImage 추가
  const [productData, setProductData] = useState(null);

  useEffect(() => {
    const fetchProductData = async () => {
      if (product) {
        try {
          const token = localStorage.getItem('token');
          if (!token) {
            throw new Error("No token found");
          }

          const config = {
            headers: {
              'Authorization': `Token ${token}`
            }
          };

          const response = await axios.get(`http://127.0.0.1:8000/myPage/recommended-products/${product.id}/`, config);
          setProductData(response.data);
        } catch (err) {
          if (err.message === "No token found") {
            alert("토큰이 없습니다. 로그인이 필요합니다.");
            navigate("/login");
          } else {
            console.error("An error occurred:", err.message);
          }
        }
      }
    };

    fetchProductData();
  }, [product, navigate]);

  const goMain = () => {
    navigate(`/`);
  };

  const goReviewcheck2 = () => {
    if (product && review) {
      navigate(`/Reviewcheck2`, { state: { product, review, selectedImage } }); // selectedImage 전달
    } else {
      alert("제품 정보나 리뷰가 없습니다.");
    }
  };

  if (!product || !review) {
    return <div>Error: 제품 정보나 리뷰가 없습니다.</div>;
  }

  return (
    <e.Container>
      <e.Header>
        <img
          id="back"
          src={`${process.env.PUBLIC_URL}/logo/backbtn.svg`}
          alt="back button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="logo"
          src={`${process.env.PUBLIC_URL}/logo/ylogo.svg`}
          alt="logo"
          width="40px"
          onClick={goMain}
        />
        <img
          id="alarm"
          src={`${process.env.PUBLIC_URL}/logo/alarm.svg`}
          alt="alarm button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <img
          id="menu"
          src={`${process.env.PUBLIC_URL}/logo/menu.svg`}
          alt="menu button"
          style={{
            position: "absolute",
            top: "8px",
            left: "8px",
            cursor: "pointer",
          }}
          onClick={() => navigate(-1)}
        />
        <e.Border>
          <div></div>
        </e.Border>
      </e.Header>

      <e.Ybox>
        <e.Top>나의 리뷰 확인하기</e.Top>
      </e.Ybox>

      <e.Body>
        <e.Box>
          <e.Box2>
            <e.Keywordd key={product.id}>
              <e.SmallBox5>
                <span style={{ fontWeight: "bold", fontSize: "15px" }}>[{product.name}]</span>
                <span style={{ fontSize: "13px" }}>{review}</span>
                <e.Click>
                  <img
                    id="review-image"
                    src={selectedImage === 'good' 
                      ? `${process.env.PUBLIC_URL}/logo/good2.png` 
                      : selectedImage === 'bad'
                      ? `${process.env.PUBLIC_URL}/logo/bad2.png`
                      : `${process.env.PUBLIC_URL}/logo/default.png`} // 선택된 이미지가 없을 경우 기본 이미지
                    alt={selectedImage || 'default'}
                    width="45px"
                  />
                </e.Click>
              </e.SmallBox5>
            </e.Keywordd>
          </e.Box2>
        </e.Box>

        <e.Button onClick={goReviewcheck2}>
          <e.ButtonText>새로운 리뷰 작성하기</e.ButtonText>
        </e.Button>
      </e.Body>
    </e.Container>
  );
};

export default Reviewcheck1;
